import React from 'react';


const Companies = () => {
    return (
        <>
            <h1>Company</h1>
            <a href="/company"><button className="btn btn-lg btn-info">Create new Company</button></a>
            <a href="/companyprofile"><button className="btn btn-lg btn-info">Profile</button></a>
            <a href="/companiesapplications"><button className="btn btn-lg btn-success">Applications</button></a>
        </>
    )
}

export default Companies;
